import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {
    Button,
    Card
  } from "react-bootstrap";
import "../css/modes.css"



class Modes extends Component {
    render() {
        return(
            <div className="modes-page">
                <a href = ""/>
                <img className="dynamic-button" src={require("../images/dynamic.jpg")} alt="Dynamic Picture" />
                <img className="playlist-button" src={require("../images/monkey-with-headphones.jpg")} alt="Monkey with Headphones" height="200" />
          </div>
        )
    }
}

export default Modes
